INSERT INTO [dbo].[DatabaseLog] ([DatabaseLogID],[PostTime],[DatabaseUser],[Event],[Schema],[Object],[TSQL],[XmlEvent]) VALUES (316,'2017-10-27 14:33:14.870',N'dbo',N'CREATE_TRIGGER',N'HumanResources',N'dEmployee',N'
CREATE TRIGGER [HumanResources].[dEmployee] ON [HumanResources].[Employee] 
INSTEAD OF DELETE NOT FOR REPLICATION AS 
BEGIN
    DECLARE @Count int;

    SET @Count = @@ROWCOUNT;
    IF @Count = 0 
        RETURN;

    SET NOCOUNT ON;

    BEGIN
        RAISERROR
            (N''Employees cannot be deleted. They can only be marked as not current.'', -- Message
            10, -- Severity.
            1); -- State.

        -- Rollback any active or uncommittable transactions
        IF @@TRANCOUNT > 0
        BEGIN
            ROLLBACK TRANSACTION;
        END
    END;
END;
