        ,p.[FirstName] + '' '' + COALESCE(p.[MiddleName], '''') + '' '' + p.[LastName] AS [FullName]
        ,e.[JobTitle]
        ,st.[Name] AS [SalesTerritory]
        ,soh.[SubTotal]
